import "./App.css";

import React, { Component } from "react";
import { CrystalList } from "./components/crystal-list/crystal-list.jsx";
class App extends Component {
  state = {
    crystals: [
      { id: 1, name: "Rose Quartz", purpose: "self-love" },
      { id: 2, name: "Selenite", purpose: "cleansing" },
      { id: 3, name: "Amber" },
      { id: 4, name: "Black Onyx" },
    ],
  };
  render() {
    return (
      <div className="App">
        <h1>crystalized</h1>
        <CrystalList crystals={this.state.crystals} />
      </div>
    );
  }
}

export default App;
